import React, { useEffect, useState } from 'react'
import { Link, Outlet, useNavigate } from 'react-router-dom'

const HomeJ = () => {
  const[myrecipe,setmyrecipe]=useState([])
  let myN=useNavigate()
  useEffect(function(){
    axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
  },[])
  my
  return  <div className='row text-center'>
      {myrecipe?.map(n=><div  ><div className='col-sm-3'><div className='thumbnail' style={{width:220, height:270, backgroundColor:'black', borderColor:'black'}}><p  key={n.id}><button to={`mymoredetails/${n._id}`}><div >   
      <img src={n.pic} width="200" height="160"></img>
      <p style={{color:'white'}}><strong>{n.name}</strong></p>
      <button class="btn" style={{color:'black'}}>More details</button></div></button><br></br></p></div></div></div>)}
      <Outlet ></Outlet>
      </div>
}

export default HomeJ
